                {/* Add a margin-top of 100px to push section lower */}
                <div className="textArea"> 
                    <h2>About Us</h2>
                    <h3>English</h3>
                    <p>
                        An easy and efficient educational technique with the help of AI can enhance the teaching and learning experience for both students and teachers. 
                        It can personalize learning, increase student engagement, provide real-time feedback, and improve the overall quality of education.
                    </p>
                    {/* Rest of content... */}
                </div>
            </section>
        </React.Fragment>
    );
};

export default AboutUs;
